import React from 'react';
import { carData } from '../carData';

export const CarList = () => {
    const styles = {
        ul:{
            border : '1px solid black'
        }
    }
  return (
    <div>
        <ul style={styles.ul}>
            {carData.map(car=> (
                <li>{car.Name}</li>
            ))}
        </ul>
    </div>
  )
}
